import React from 'react';

export const Icon = (props) =>{

		const icon = {
			bright:'../../assets/icons/bright.png',
			sheet:require('../../assets/icons/sheet.png'),
		}
	return(
		<div>
			<img src={icon.sheet} alt="" width={props.size} height={props.size}/>
		</div>
	);
}
